import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../services/api';

function Cart() {
  const [cart, setCart] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) return navigate('/login');

    const fetchCart = async () => {
      try {
        const res = await api.get('/api/v1/carts', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setCart(res.data);
      } catch (err) {
        if (err.response?.status === 401) {
          localStorage.removeItem('token');
          navigate('/login');
        } else {
          console.error(err);
        }
      }
    };

    fetchCart();
  }, [navigate]);

  const handleRemove = async (itemId) => {
    const token = localStorage.getItem('token');
    try {
      await api.delete(`/api/v1/carts/items/${itemId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      const res = await api.get('/api/v1/carts', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setCart(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleClear = async () => {
    const token = localStorage.getItem('token');
    try {
      await api.delete('/api/v1/carts', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setCart({ items: [], total: 0 });
    } catch (err) {
      console.error(err);
    }
  };

  const handleUpdateQuantity = async (itemId, quantity) => {
    const token = localStorage.getItem('token');
    try {
      await api.put(`/api/v1/carts/items/${itemId}`, {
        quantity: quantity,
      }, {
        headers: { Authorization: `Bearer ${token}` },
      });

      const res = await api.get('/api/v1/carts', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setCart(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleCheckout = async () => {
    navigate('/checkout');
  };

  if (!cart) return <div>Loading...</div>;

  return (
    <div className="container">
      <h2>Your Cart</h2>
      {cart.items.length === 0 ? (
        <p>Your cart is empty</p>
      ) : (
        <div>
          {cart.items.map((item) => (
            <div
              key={item.itemId}
              style={{
                display: 'flex',
                alignItems: 'center',
                marginBottom: '10px',
                background: 'white',
                padding: '10px',
                borderRadius: '4px',
              }}
            >
              <img
                src={`/v1/products/image/${item.product.imageUrl}`}
                alt={item.product.name}
                style={{ width: '100px', height: '100px', objectFit: 'cover' }}
              />
              <div style={{ marginLeft: '20px', flex: 1 }}>
                <h4>{item.product.name}</h4>
                <p>Price: ₹{item.product.price}</p>
                <p>Subtotal: ₹{item.subtotal}</p>

                <div style={{ display: 'flex', alignItems: 'center' }}>
                  <button
                    onClick={() =>
                      handleUpdateQuantity(item.itemId, item.quantity - 1)
                    }
                    disabled={item.quantity <= 1}
                  >
                    -
                  </button>
                  <span style={{ margin: '0 10px' }}>{item.quantity}</span>
                  <button
                    onClick={() =>
                      handleUpdateQuantity(item.itemId, item.quantity + 1)
                    }
                  >
                    +
                  </button>
                </div>

                <button
                  className="button"
                  onClick={() => handleRemove(item.itemId)}
                  style={{ marginTop: '10px' }}
                >
                  Remove
                </button>
              </div>
            </div>
          ))}
          <h3>Total: ₹{cart.total}</h3>
          <button
            className="button"
            onClick={handleCheckout}
            style={{ marginTop: '10px' }}
          >
            Proceed to Checkout
          </button>
          <button
            className="button"
            onClick={handleClear}
            style={{ marginTop: '10px', marginLeft: '10px' }}
          >
            Clear Cart
          </button>
        </div>
      )}
    </div>
  );
}

export default Cart;
